import React from 'react'
import s from '../SortingBlock.module.css'

export default function FilterForm() {
  return (
    <div className={s.sorting_section}>
        <p className={s.sorting_title}>Price</p>
        <input type='number' placeholder='from' className={s.price_input} />
        <input type='number' placeholder='to' className={s.price_input} />
    </div>
  )
}
